		public int[] GetEdges(PlanetFace face) {
			int sideResolution = face.side.planet.sideResolution;
			PlanetSide side = face.side;

			//Debug.Log("faceY: " + face.coordinates.y + ", sideRes: " + sideResolution);

			int nLOD = side.faces[
				face.coordinates.x, 
				face.coordinates.y < sideResolution - 2 ? 
					face.coordinates.y + 1 : face.coordinates.y
			].LOD;
			int sLOD = side.faces[
				face.coordinates.x, 
				face.coordinates.y > 0 ? 
					face.coordinates.y - 1 : face.coordinates.y
			].LOD;
			int eLOD = side.faces[
				face.coordinates.x < sideResolution - 2 ?
					face.coordinates.x + 1 : face.coordinates.x, face.coordinates.y
			].LOD;
			int wLOD = side.faces[
				face.coordinates.x > 0 ?
					face.coordinates.x - 1 : face.coordinates.x, face.coordinates.y
			].LOD;

			int edgeIndex = 0;
			if(nLOD < face.LOD)
				edgeIndex += 1; // N
			if(sLOD < face.LOD)
				edgeIndex += 2; // S
			if(eLOD < face.LOD)
				edgeIndex += 4; // E
			if(wLOD < face.LOD)
				edgeIndex += 8; // W
			

			List<int> edgeTriangles = new List<int>();
			switch(edgeIndex) {
				case 0:
					foreach(int v in regularEdges[face.LOD - 1][0])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][1])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][2])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][3])
						edgeTriangles.Add(v);
					break;
				case 1:
					foreach(int v in regularEdges[face.LOD - 1][0])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][1])
						edgeTriangles.Add(v);
					foreach(int v in fanEdges[face.LOD - 1][2]) // North
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][3])
						edgeTriangles.Add(v);
					break;
				case 2:
					foreach(int v in fanEdges[face.LOD - 1][0]) // South
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][1])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][2])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][3])
						edgeTriangles.Add(v);
					break;
				case 3:
					foreach(int v in fanEdges[face.LOD - 1][0]) // South
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][1])
						edgeTriangles.Add(v);
					foreach(int v in fanEdges[face.LOD - 1][2]) // North
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][3])
						edgeTriangles.Add(v);
					break;
				case 4:
					foreach(int v in regularEdges[face.LOD - 1][0])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][1])
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][2])
						edgeTriangles.Add(v);
					foreach(int v in fanEdges[face.LOD - 1][3]) // East
						edgeTriangles.Add(v);
					break;
				case 5:
