						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][3])
						edgeTriangles.Add(v);
					break;
				case 12:
					foreach(int v in regularEdges[face.LOD - 1][1])
						edgeTriangles.Add(v);
					foreach(int v in fanEdges[face.LOD - 1][1]) // West
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][2])
