					foreach(int v in fanEdges[face.LOD - 1][2]) // North
						edgeTriangles.Add(v);
					foreach(int v in fanEdges[face.LOD - 1][3]) // East
						edgeTriangles.Add(v);
					break;
				case 14:
					foreach(int v in fanEdges[face.LOD - 1][0]) // South
						edgeTriangles.Add(v);
					foreach(int v in fanEdges[face.LOD - 1][1]) // West
						edgeTriangles.Add(v);
					foreach(int v in regularEdges[face.LOD - 1][2])
