		public int[] EdgeSolver(int highEdgeSize, int edge) {
			int rotations = 4 - edge;
			int[][] hlVertices = CreateHighLowArrays(highEdgeSize);
			for(int h = 0, l = 0; h < highEdgeSize; h++) {
				hlVertices[0][h] = highEdgeSize + h;
				if(h % 2 == 0) {
					hlVertices[1][l] = h;
					l++;
				}
			}
			int[] triangles = new int[(hlVertices[0].Length + hlVertices[1].Length - 2) * 3];
			int[,] faceVertices = new int[highEdgeSize, highEdgeSize];
			for(int y = 0, v = 0; y < highEdgeSize; y++)
				for(int x = 0; x < highEdgeSize; x++)
					faceVertices[x, y] = v++;
			for(int i = 0; i < rotations; i++)
				faceVertices = RotateMatrix(faceVertices, highEdgeSize);
			for(int t = 0, v = 0; t < triangles.Length; t += 9, v += 2) {
				triangles[t]     = triangles[t + 3] = faceVertices[v, 0];
				triangles[t + 1] = faceVertices[v, 1];
				triangles[t + 2] = triangles[t + 4] = triangles[t + 7] = faceVertices[v + 1, 1];
				triangles[t + 5] = triangles[t + 6] = faceVertices[v + 2, 0];
				triangles[t + 8] = faceVertices[v + 2, 1];
			}
			return triangles;
		}

		public int[] RegularEdge(int faceSize, int edge) {
			int rotations = 4 - edge;
			int[] triangles = new int[(faceSize - 1) * 6];
			int[,] faceVertices = new int[faceSize, faceSize];
			for(int y = 0, v = 0; y < faceSize; y++)
				for(int x = 0; x < faceSize; x++)
					faceVertices[x, y] = v++;
			for(int i = 0; i < rotations; i++)
				faceVertices = RotateMatrix(faceVertices, faceSize);

			for(int t = 0, v = 0; t < triangles.Length; t += 6, v += 1) {
				triangles[t]     = faceVertices[v, 0];
				triangles[t + 1] = triangles[t + 4] = faceVertices[v, 1];
				triangles[t + 2] = triangles[t + 3] = faceVertices[v + 1, 0];
				triangles[t + 5] = faceVertices[v + 1, 1];
			}

			return triangles;
		}

		private int[][] CreateHighLowArrays(int highEdgeSize) {
			return new int[][] {
				new int[highEdgeSize],
				new int[(highEdgeSize - 1) / 2 + 1]
			};
		}

		static int[,] RotateMatrix(int[,] matrix, int n) {
			int[,] ret = new int[n, n];
			for(int i = 0; i < n; ++i)
				for(int j = 0; j < n; ++j)
					ret[i, j] = matrix[n - j - 1, i];
			return ret;
		}

		private void PrintTrianglesArray(int[] triangles) {
			string s = string.Empty;
			foreach(int t in triangles) {
				for(int i = 0; i < 5 - t.ToString().Length; i++)
					s += " ";
				s += t + ", ";
			}
			Debug.Log(s);
		}
	}
}
